import React from "react";
import { Text, Pro } from "./Text";
const userLogin = false;
// import Pro from "./Pro";
// import SearchParams from "../SearchParams";
const names = ["john", "Rami", "bob", "Rony"];

const App = () => {
  const listName = names.map((name, i) => <li key={i}>{name}</li>);
  return (
    <React.Fragment>
      <h1>Hello world</h1>
      <Text name="dude" />
      <Pro name="jad" />
      <h1>{userLogin ? "Hey" : "LoginPls"}</h1>
      <ul>{listName}</ul>
    </React.Fragment>
  );
};

export default App;
